import React, { useState } from 'react'
import { useDispatch, useSelector } from 'react-redux'

const Todo = () => {
    const dispatch = useDispatch()
    const nwarr = useSelector(state => state.costom.Mydata)

    const mybtn = () => {
        dispatch({
            type: "add"
        })
    }


   
    return (
        <div className="container">
            <h1>TodoList </h1>
            <input className='input' type="text" />
            <button onClick={mybtn} className='btn-primary'>Add task</button>

        </div>

    )

}

export default Todo
